import {Component, OnInit} from '@angular/core';
import {CommandModel} from "../../model/command";
import {CommandService} from "../command.service";

@Component({
  selector: 'app-command-list',
  templateUrl: './command-list.component.html',
  styleUrls: ['./command-list.component.css']
})
export class CommandListComponent implements OnInit{


  commands! : CommandModel[];
  employerId? : number;

  constructor(private commandeService : CommandService) {}

  ngOnInit(): void {
    this.employerId=localStorage.getItem('employer_id');
    this.commandeService.findByEmployerId(this.employerId).subscribe(v=>this.commands =v);
    }
